import React from 'react'
import { SliderData } from './SliderData'

const ImageSlider = () => {
    return (
        <>
            {SliderData.map((slider, index) => {
                return <img src={slider.image} alt='event image' />;
                
            })}
        </>
    );
};

export default ImageSlider
